import Header from './header';
import Head from 'next/head';
import Add_todos from '../components/addTodo';




const Layouts = (props) => (
  <div>
    <Head>
        <title>Todo App</title>
    </Head>
    <Header />
    <Add_todos AddTodo={this.props.AddTodo}/>
    {props.children}
  </div>
);
  
  export default Layouts;
